description:
Verenigde Staten
Thriller
101 minuten

een goeie film

met Penn Badgley, Dylan Walsh en Amber Heard

Michael Harding keert terug naar huis na een periode op de militaire school gezeten te hebben. Eenmaal thuis ziet hij dat zijn 
moeder erg gelukkig is met haar nieuwe vriend, maar Michael vertrouwt het niet helemaal. David, de nieuwe vriend van zijn moeder, 
is verdacht vaak aanwezig om een helpende hand te bieden. Is hij echt zo aardig als hij lijkt, of zijn de twijfels van Michael 
terecht?
